window.bookSummaryJSON = "<p>Walt and Oz need to level up to survive and every moment is going to hurt.</p> <p>Walter LePointe and Oswald Blackwell just woke up inside of the online role playing game Realms of Th'loria. With no memory of how they arrived, Walt and Oz soon learn the hard way that living in an epic fantasy world isn't all it's cracked up to be. As level one characters with no skills or experience, nothing can prepare them for their new lives as they prepare to enter the realm.</p>"; 
